import React from "react";
import TodoItem from "./TodoItem";

const TodoItems = ({ todoList }) => {
  console.log(todoList);
  return (
    <div>
      <div>{todoList[0].content}</div>

      <div>{todoList[1].content}</div>
      <TodoItem />
    </div>
  );
};

export default TodoItems;
